import React from "react";

function Card(props) {
        return (
            <article className="element">
                <img className="element__photo" src={props.link} alt={`Изображение ${props.name}`} />
                <button className="element__trash" type="button" aria-label="Удалить фото"/>
                <h2 className="element__text">{`${props.name}`}</h2>
                <div className="element__like-block">
                    <button className="element__like" type="button" aria-label="Поставить лайк"/>
                    <p className="element__like-number">{`${props.likes}`}</p>
                </div>
            </article>
        )

}
export default Card;
